Biology Short Answer 
 A commonly-used method of classifying animals is to find a shared ancestral characteristic, and use it to group organisms as, either within the group or outside the group. Identify all of the following three animals, that are inside the group, for the hinged jaw characteristic: 
 1) Lamprey; 
 2) Turtle; 
 3) Bass.

Math Short Answer 
 Identify all of the following four expressions, that are ODD functions: 
 1) Cube root of x; 
 2) Cosine of x; 
 3) Tangent of x; 
 4) e to the x power.

Chemistry Short Answer 
 Identify all of the following three statements that are true, of concentration cells: 
 1) They have standard cell potentials equal to zero; 
 2) The spontaneous reaction is always from the less-concentrated solution to the more-concentrated solution; 
 3) Concentration cells can always proceed spontaneously.

Chemistry Short Answer 
 Rank the following three gases in terms of increasing rate of effusion: 
 1) Chlorine; 
 2) Helium; 
 3) Nitrogen.

Chemistry Short Answer 
 Rank the following three elements in increasing order of, effective nuclear charge felt by their valence electrons: 
 1) Oxygen; 
 2) Boron; 
 3) Beryllium.

Chemistry Short Answer 
